window.bookSummaryJSON = "<p>With freedom, comes choice.</p> <p>Dr. Meghan Forester’s dream has finally come true. A vaccine for the deadly Makanza virus is spreading throughout the world. Borders are open. The Kazzies are free.</p> <p>But just when happiness and hope are infiltrating society, Meghan’s world comes tumbling down. Davin’s first love reappears. The Kazzies are incessantly harassed. A young girl falls gravely ill.</p> <p>Now, more than ever, Meghan knows she has a job to do. Only a cure will solve the relentless problems that have plagued the world since the First Wave. But just when a cure is within her grasp, a shattering event threatens to end it all.</p> <p>Recommended listening order:</p> <p><i>The Second Wave</i> - Book 0</p> <p><i>Compound 26 </i>- Book 1</p> <p><i>Reservation 1 </i>- Book 2</p> <p><i>Section 12 </i>- Book 3</p> <p><i>Division 5</i> - Book 4</p> <p>Download <i>Division 5</i> now!</p>"; 
